import React from 'react';
import '../../css/client_css/SocialMedia.scss';

// icons
import { FaGithub } from 'react-icons/fa';

const SocialMedia = () => {
    return (
        <div id="social-media">
            <FaGithub />
            <FaGithub />
            <FaGithub />
        </div>
    );
};
export default SocialMedia;
